Jake and the Never Land Pirates is a musical interactive animated Disney Junior show created by Bobs Gannaway, based on the successful Peter Pan franchise that was in turn based on the famous book and play by British author J.M. Barrie. 

This series, a new take on the classic &quot;Peter Pan&quot; story, follows the Never Land adventures of a group of child pirates -- Jake, Izzy and Cubby -- as they try to outwit Captain Hook and Smee. The show features original music performed by the Never Land Pirate Band.

These episodes were broadcast on cable &amp; satellite television in the US between November 2012 and January 2013.

